import { Box, Card, CardHeader, CardMedia, Typography } from '@mui/material';

export default function Project(){
    return (
        <Card
            sx={{
                height: 350,
                width: 275,
                margin: 5,
                backgroundColor: secondary,
            }}
        >
            <CardHeader
                title={<Typography align="center" variant="h4">Good Flicks</Typography>}
            />
            <Box
                sx={{
                    display: 'flex',
                    justifyContent: 'center'
                }}
            >
                <CardMedia
                    component="img"
                    image="GoodFlicks.png"
                    alt="Paella dish"
                    sx={{
                        height: 150,
                        width: 150,
                        justifyContent: "center"
                    }}
                />
            </Box>
        </Card>
    )
}
